  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Desert NWR Complex for the next 15 years. This
  plan outlines the Complex vision and purpose and describes how Desert NWR Complex
  will contribute to the overall mission of the Refuge System. The plan provides an
  introduction to the refuges, an overview of the CCP process, a list of alternatives,
  the affected environment, environmental consequences, and compliance. Key planning
  issues include: threatened and endangered species, fire management, research, visitor
  services, cultural resources, climate change, bighorn sheep management, wildlife
  diversity, and water resources.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
